import{_ as e,e as t}from"./app.269ed0ef.js";var i="/Git/\u5408\u5E76\u524D.png",a="/Git/\u5408\u5E76\u540E.png",c="/Git/--no-ff.png",r="/Git/ff.png",d="/Git/merge.svg",o="/Git/rebase.svg";const p={},s=t('<h1 id="\u5206\u652F\u7BA1\u7406" tabindex="-1"><a class="header-anchor" href="#\u5206\u652F\u7BA1\u7406" aria-hidden="true">#</a> \u5206\u652F\u7BA1\u7406</h1><h2 id="\u521B\u5EFA\u4E0E\u5408\u5E76\u5206\u652F" tabindex="-1"><a class="header-anchor" href="#\u521B\u5EFA\u4E0E\u5408\u5E76\u5206\u652F" aria-hidden="true">#</a> \u521B\u5EFA\u4E0E\u5408\u5E76\u5206\u652F</h2><p>\u6700\u5F00\u59CB\u7684\u65F6\u5019\uFF0C\u9ED8\u8BA4\u5206\u652F master \u662F\u4E00\u6761\u7EBF\uFF0CGit \u4F7F\u7528 master \u6307\u5411\u6700\u65B0\u7684\u63D0\u4EA4\uFF0C\u7136\u540E\u518D\u4F7F\u7528 <code>HEAD</code> \u6307\u5411 <code>master</code>\uFF0C\u8FD9\u6837\u5C31\u786E\u5B9A\u4E86\u5F53\u524D\u5206\u652F\uFF0C\u4EE5\u53CA\u5F53\u524D\u5206\u652F\u7684\u63D0\u4EA4\u70B9\u3002</p><p>\u6BCF\u6B21\u63D0\u4EA4\uFF0Cmaster \u5206\u652F\u90FD\u4F1A\u5411\u524D\u79FB\u52A8\u4E00\u6B65\uFF0C\u968F\u7740\u4E0D\u65AD\u63D0\u4EA4\uFF0Cmaster \u5206\u652F\u7684\u7EBF\u4E5F\u8D8A\u6765\u8D8A\u957F\u3002</p><p>\u5F53\u521B\u5EFA\u4E00\u4E2A\u65B0\u5206\u652F\u4F8B\u5982 dev \u5206\u652F\u65F6\uFF0CGit \u4F1A\u65B0\u5EFA\u4E00\u4E2A\u540D\u5B57\u4E3A dev \u7684\u6307\u9488\uFF0C\u6307\u5411 master \u76F8\u540C\u7684\u63D0\u4EA4\uFF0C\u518D\u628A HEAD \u6307\u5411 dev\uFF0C\u5C31\u8868\u793A\u5F53\u524D\u5206\u652F\u5728 dev \u4E0A\u3002</p><ul><li><p>\u521B\u5EFA\u5206\u652F\u7684\u56DB\u79CD\u65B9\u5F0F\uFF1A</p><ul><li>\u4F7F\u7528 <code>git checkout -b &lt;branch&gt;</code> \u521B\u5EFA\u5E76\u5207\u6362\u5230\u6307\u5B9A\u5206\u652F\u3002</li><li>\u4F7F\u7528 <code>git switch -c &lt;branch&gt;</code> \u521B\u5EFA\u5E76\u5207\u6362\u5230\u6307\u5B9A\u5206\u652F\u3002</li><li>\u4F7F\u7528 <code>git branch &lt;branch&gt;</code> \u521B\u5EFA\u4E00\u4E2A\u5206\u652F\u3002</li><li>\u4F7F\u7528 <code>git fetch &lt;repository&gt; :&lt;branch&gt;</code>\u521B\u5EFA\u4E00\u4E2A\u65B0\u5206\u652F\u3002</li></ul></li><li><p>\u5220\u9664\u6307\u5B9A\u5206\u652F\uFF1A</p><p>\u4F7F\u7528 <code>git branch -d &lt;branch&gt;</code> \u547D\u4EE4\u5220\u9664\u4E00\u4E2A\u5206\u652F\u3002</p></li><li><p>\u5220\u9664\u4E00\u4E2A\u6CA1\u6709\u88AB\u5408\u5E76\u8FC7\u7684\u5206\u652F\uFF1A</p><p>\u4F7F\u7528 <code>git branch -D &lt;branch&gt;</code> \u547D\u4EE4\u5F3A\u884C\u5220\u9664\u3002</p></li><li><p>\u5220\u9664\u4E00\u4E2A\u8FDC\u7A0B\u5206\u652F\uFF1A</p><p>\u4F7F\u7528 <code>git push &lt;repository&gt; \uFF1A&lt;branch&gt;</code>\u3002</p></li><li><p>\u5207\u6362\u5206\u652F\uFF1A</p><ul><li>\u4F7F\u7528 <code>git switch &lt;branch&gt;</code> \u547D\u4EE4\u5207\u6362\u5230\u6307\u5B9A\u5206\u652F\u3002</li><li>\u4F7F\u7528 <code>git checkout &lt;branch&gt;</code> \u547D\u4EE4\u5207\u6362\u5230\u6307\u5B9A\u5206\u652F\u3002</li></ul></li><li><p>\u67E5\u770B\u5206\u652F\u4FE1\u606F\uFF1A</p><p>\u4F7F\u7528 <code>git branch</code> \u547D\u4EE4\u67E5\u770B\u5F53\u524D\u5206\u652F\u548C\u5176\u4ED6\u5206\u652F\u3002</p></li><li><p>\u5408\u5E76\u5206\u652F\uFF1A</p><p>\u5408\u5E76\u67D0\u4E2A\u5206\u652F\u5230\u5F53\u524D\u5206\u652F\uFF1A<code>git merge &lt;name&gt;</code>\u3002</p></li></ul><h2 id="\u89E3\u51B3\u51B2\u7A81" tabindex="-1"><a class="header-anchor" href="#\u89E3\u51B3\u51B2\u7A81" aria-hidden="true">#</a> \u89E3\u51B3\u51B2\u7A81</h2><p>\u5F53\u4E24\u4E2A\u5206\u652F\u5171\u540C\u524D\u8FDB\u65F6\u53EF\u80FD\u4F1A\u51FA\u73B0\u4E0B\u9762\u7684\u60C5\u51B5\u3002</p><p><img src="'+i+'" alt="\u5408\u5E76\u524D"></p><p>\u8FD9\u79CD\u60C5\u51B5\u4E0B\uFF0CGit \u65E0\u6CD5\u6267\u884C\u5FEB\u901F\u5408\u5E76\u53EA\u80FD\u5C1D\u8BD5\u628A\u5404\u81EA\u7684\u4FEE\u6539\u5408\u5E76\u8D77\u6765\uFF0C\u4F46\u8FD9\u6837\u53EF\u80FDHi\u51FA\u73B0\u51B2\u7A81\uFF0CGit \u4F1A\u544A\u8BC9\u6211\u4EEC\u5728\u54EA\u4E2A\u6587\u4EF6\u4E2D\u51FA\u73B0\u4E86\u51B2\u7A81\uFF0C\u5FC5\u987B\u7531\u6211\u4EEC\u624B\u52A8\u4FEE\u6539\u89E3\u51B3\u51B2\u7A81\u540E\u518D\u63D0\u4EA4\uFF0C\u63D0\u4EA4\u540E\u5206\u652F\u53D8\u6210\u4E86\u4E0B\u9762\u8FD9\u6837\uFF1A</p><p><img src="'+a+'" alt="\u5408\u5E76\u540E"></p><h2 id="\u5206\u652F\u7BA1\u7406\u7B56\u7565" tabindex="-1"><a class="header-anchor" href="#\u5206\u652F\u7BA1\u7406\u7B56\u7565" aria-hidden="true">#</a> \u5206\u652F\u7BA1\u7406\u7B56\u7565</h2><p>\u901A\u5E38\u60C5\u51B5\u4E0B\uFF0C\u5408\u5E76\u5206\u652F\u65F6\uFF0CGit \u4F1A\u7528 Fast forward \u6A21\u5F0F\uFF0C\u8FD9\u79CD\u6A21\u5F0F\u5728\u5220\u9664\u5206\u652F\u540E\u4F1A\u4E22\u6389\u5206\u652F\u4FE1\u606F\u3002</p><p>\u5982\u679C\u8981\u7981\u7528\u8FD9\u4E2A\u6A21\u5F0F\uFF0CGit \u4F1A\u5728 merge \u65F6\u751F\u6210\u4E00\u4E2A\u65B0\u7684 commit\uFF0C\u8FD9\u6837\u4ECE\u5206\u652F\u5386\u53F2\u4E0A\u5C31\u53EF\u4EE5\u770B\u51FA\u5206\u652F\u4FE1\u606F\u3002</p><p>\u4F7F\u7528 <code>git merge --no-ff -m &lt;message&gt; &lt;branch&gt;</code> \u547D\u4EE4\uFF0C\u901A\u8FC7 <code>-no-ff</code> \u53C2\u6570\u7981\u7528 Fast forward \u6A21\u5F0F\uFF0C\u7531\u4E8E\u8FD9\u6837\u5408\u5E76\u4F1A\u521B\u5EFA\u4E00\u4E2A\u65B0\u7684 commit\uFF0C\u6240\u4EE5\u52A0\u4E0A <code>-m</code> \u53C2\u6570\uFF0C\u628A\u63D0\u4EA4\u4FE1\u606F\u5199\u8FDB\u53BB\u3002</p><p>\u4E0D\u4F7F\u7528 Fast forward \u6A21\u5F0F\u5408\u5E76\u540E\u5C31\u50CF\u4E0B\u9762\u8FD9\u6837\uFF1A</p><p><img src="'+c+'" alt="--no-ff"></p><p>\u53CD\u4E4B\u50CF\u8FD9\u6837\uFF1A</p><p><img src="'+r+'" alt="ff"></p><h2 id="bug-\u5206\u652F" tabindex="-1"><a class="header-anchor" href="#bug-\u5206\u652F" aria-hidden="true">#</a> Bug \u5206\u652F</h2><p>\u5F53\u4EFB\u52A1\u6CA1\u6709\u5B8C\u6210\u65E0\u6CD5\u63D0\u4EA4\uFF0C\u800C\u53C8\u6709\u4E86\u65B0\u4EFB\u52A1\u65F6\uFF0C\u53EF\u4EE5\u4F7F\u7528 Git \u63D0\u4F9B\u7684 stash \u529F\u80FD\u6682\u5B58\u5F53\u524D\u5DE5\u4F5C\u73B0\u573A\uFF0C\u5C06\u6765\u6062\u590D\u73B0\u573A\u540E\u7EE7\u7EED\u5DE5\u4F5C\u3002</p><p>\u4F7F\u7528 <code>git stash</code> \u547D\u4EE4\u5C06\u5F53\u524D\u8FD8\u5728\u5DE5\u4F5C\u533A\u7684\u5185\u5BB9\u6682\u5B58\u8D77\u6765\u3002</p><p>\u5B8C\u6210\u5176\u4ED6\u4EFB\u52A1\u540E\uFF0C\u4F7F\u7528 <code>git stash apply</code> \u547D\u4EE4\u53EF\u4EE5\u6062\u590D\u5DE5\u4F5C\u533A\uFF0C\u4F46\u8FD9\u4E2A\u547D\u4EE4\u4E0D\u4F1A\u5220\u9664 stash \u7684\u5185\u5BB9\uFF0C\u9700\u8981\u518D\u4F7F\u7528 <code>git stash drop</code> \u5220\u9664 stash \u4E2D\u7684\u5185\u5BB9\uFF0C\u6216\u8005\u76F4\u63A5\u4F7F\u7528 <code>git stash pop</code> \u547D\u4EE4\u4E00\u6B21\u5B8C\u6210\u6062\u590D\u548C\u5220\u9664\u3002</p><p>\u901A\u8FC7 <code>git stash list</code> \u53EF\u4EE5\u67E5\u770B\u6240\u6709\u7684 stash\uFF0C\u7136\u540E\u901A\u8FC7 <code>git stash apply stash@{&lt;id&gt;}</code> \u6062\u590D\u6307\u5B9A\u7684 stash\u3002</p><p>\u5982\u679C\u53EA\u60F3\u590D\u5236\u67D0\u6B21\u63D0\u4EA4\u6240\u505A\u7684\u4FEE\u6539\u800C\u4E0D\u662F\u5408\u5E76\u6574\u4E2A\u5206\u652F\uFF0C\u53EF\u4EE5\u4F7F\u7528 <code>git cherry-pick &lt;commit&gt;</code> \u53EF\u4EE5\u590D\u5236\u4E00\u4E2A\u7279\u5B9A\u7684\u63D0\u4EA4\u5230\u5F53\u524D\u5206\u652F\u3002</p><h2 id="\u591A\u4EBA\u534F\u4F5C" tabindex="-1"><a class="header-anchor" href="#\u591A\u4EBA\u534F\u4F5C" aria-hidden="true">#</a> \u591A\u4EBA\u534F\u4F5C</h2><p>\u591A\u4EBA\u534F\u4F5C\u7684\u6D41\u7A0B\u5982\u4E0B\uFF1A</p><ul><li>\u514B\u9686\u8FDC\u7A0B\u4ED3\u5E93\u5230\u672C\u5730\u3002</li><li>\u521B\u5EFA\u65B0\u5206\u652F\u6216\u5728\u5DF2\u6709\u7684\u5F00\u53D1\u5206\u652F\u4E0A\u8FDB\u884C\u5F00\u53D1\u3002</li><li>\u63D0\u4EA4\u5230\u672C\u5730\u4ED3\u5E93\u3002</li><li>\u5C1D\u8BD5\u5411\u8FDC\u7A0B\u4ED3\u5E93\u63A8\u9001\u3002</li><li>\u5982\u679C\u63A8\u9001\u5931\u8D25\uFF0C\u4F7F\u7528 <code>git fetch</code> \u7136\u540E\u518D\u4F7F\u7528 <code>git merge</code> \u6216\u8005 <code>git rebase</code> \u4E24\u4E2A\u547D\u4EE4\u6216\u8005\u76F4\u63A5\u4F7F\u7528 <code>git pull</code> \u540C\u6B65\u8FDC\u7A0B\u4ED3\u5E93\u3002</li><li>\u5982\u679C <code>git pull</code> \u63D0\u793A <code>no tracking information</code> \u8BF4\u660E\u672C\u5730\u5206\u652F\u548C\u8FDC\u7A0B\u5206\u652F\u7684\u94FE\u63A5\u5173\u7CFB\u6CA1\u6709\u521B\u5EFA\uFF0C\u4F7F\u7528\u547D\u4EE4 <code>git branch --set-upstream-to &lt;branch&gt; ${repository}/${branch}</code>\u3002</li><li>\u5982\u679C\u548C\u8FDC\u7A0B\u4ED3\u5E93\u6709\u51B2\u7A81\u5C31\u5148\u89E3\u51B3\u51B2\u7A81\u5E76\u63D0\u4EA4\u3002</li><li>\u6CA1\u6709\u51B2\u7A81\u540E\u63A8\u9001\u5230\u8FDC\u7A0B\u4ED3\u5E93\u3002</li></ul><h2 id="rebase" tabindex="-1"><a class="header-anchor" href="#rebase" aria-hidden="true">#</a> Rebase</h2><p>\u5728\u8FDB\u884C\u5206\u652F\u5408\u5E76\u65F6\uFF0C\u6709 <code>merge</code> \u548C <code>rebase</code> \u4E24\u79CD\u9009\u62E9\uFF0Cmerge \u4F1A\u518D\u6B21\u521B\u5EFA\u4E00\u6B21\u63D0\u4EA4\u4F5C\u4E3A\u5408\u5E76\u540E\u7684\u8D77\u70B9\uFF0Crebase \u4E0D\u4F1A\u521B\u5EFA\u63D0\u4EA4\uFF0C\u800C\u662F\u5C06\u8981\u5408\u5E76\u7684\u5206\u652F\u76F4\u63A5\u79FB\u52A8\u5230\u8981\u5E76\u5165\u7684\u5206\u652F\u7684\u9876\u7AEF\u3002</p><p><img src="'+d+'" alt="merge"></p><p><img src="'+o+'" alt="rebase"></p><p>\u4F7F\u7528 <code>git rebase &lt;branch&gt;</code> \u547D\u4EE4\u5C06\u5F53\u524D\u5206\u652F\u53D8\u57FA\u5230\u6307\u5B9A\u5206\u652F\uFF0C\u5982\u679C\u53D1\u751F\u4E86\u51B2\u7A81\uFF0C\u5C31\u5148\u89E3\u51B3\u51B2\u7A81\uFF0C\u7136\u540E\u4F7F\u7528 <code>git rebase --continue</code> \u5B8C\u6210\u540E\u7EED\u64CD\u4F5C\u3002\u8FD8\u53EF\u4EE5\u6DFB\u52A0 <code>-i</code> \u53C2\u6570\u4F7F\u7528\u4EA4\u4E92\u5F0F rebase\u3002</p>',33);function l(h,g){return s}var m=e(p,[["render",l]]);export{m as default};
